import React from "react";
import Headings from "./Components/Headings";
import Para from "./Components/Para";
import RandomImages from "./Components/RandomImages";
import name,{address,education} from "./Components/Bio"
import { add,div,mul,sup } from "./Components/Calculator";


function App() {
    return (
        <>
            <Headings />
            <Para />
            <RandomImages />
            <RandomImages />
            <ol>
                <li>{name}</li>
                <li>{address}</li>
                <li>{education}</li>
            </ol>
            <center>
                <p>Addition of two numbers is {add(1,2)}</p>
                <p>Addition of two numbers is {sup(1,2)}</p>
                <p>Addition of two numbers is {div(14,3).toFixed(4)}</p>
                <p>Addition of two numbers is {mul(1,2)}</p>
            </center>
        </>
    )
};


export default App;
